raw_question: Return the different names of cities that are in Asia and for which Chinese is the official language. 
question_index: 787 
constants:
 - Chinese
 - T
 - Asia
join_columns:
 - code
 - countrycode
columns:
 - continent
 - language
 - isofficial
filters:
 - '='
comment: |-
  SELECT DISTINCT T3.Name
  FROM country AS T1
  JOIN countrylanguage AS T2 ON T1.Code = T2.CountryCode
  JOIN city AS T3 ON T1.Code = T3.CountryCode
  WHERE T2.IsOfficial = 'T'
    AND T2.Language = 'Chinese'
    AND T1.Continent = "Asia"

